import React from "react";
import fj from "./fuji.jpg";

export default function Travel(p) {
  return (
    <header className="">
      <img src={fj} alt="Mount Fuji" />
      <h2>Header component</h2>
      <h4>React-course -project 3</h4>
    </header>
  );
}
